INSERT INTO `empresas` VALUES('1','Grupo Nutresa','Grupo líder en la industria de alimentos en Latinoamérica, con presencia en más de 75 países. Su portafolio diversificado abarca carnes frías, galletas, chocolates, café y helados. Su modelo de sostenibilidad y expansión regional la posiciona como una empresa sólida y de bajo riesgo para inversiones a largo plazo.','270.37','Fri Oct 31 2025 22:45:36 GMT-0500 (hora estándar de Colombia)','AAPL');
INSERT INTO `empresas` VALUES('2','Ecopetrol','Principal empresa de energía de Colombia y una de las más grandes de América Latina. Se dedica a la exploración, producción, refinación y transporte de petróleo, gas y energías renovables. Está en proceso de transición hacia un modelo energético sostenible, lo que abre oportunidades en innovación y diversificación.','517.81','Sun Nov 02 2025 01:39:51 GMT-0500 (hora estándar de Colombia)','MSFT');
INSERT INTO `empresas` VALUES('3','Grupo Cibest','Holding tecnológico colombiano especializado en automatización, desarrollo de software empresarial e integración digital. Cibest impulsa la transformación digital en sectores industriales, financieros y gubernamentales, destacándose por su innovación en soluciones basadas en inteligencia artificial y big data.','281.19','Sun Nov 02 2025 02:16:30 GMT-0500 (hora estándar de Colombia)','GOOGL');
INSERT INTO `empresas` VALUES('4','Grupo Aval','El grupo financiero más grande de Colombia, con operaciones en banca, seguros, pensiones e inversiones. Controla entidades como Banco de Bogotá, Banco de Occidente y Banco AV Villas. Su fortaleza financiera y diversificación lo convierten en un referente de estabilidad y rentabilidad en el sector financiero.','456.56','Sun Nov 02 2025 05:55:27 GMT-0500 (hora estándar de Colombia)','TSLA');
INSERT INTO `empresas` VALUES('5','Celsia','Empresa del Grupo Argos enfocada en generación y distribución de energía con un fuerte compromiso ambiental. Opera plantas hidroeléctricas, solares y térmicas en Colombia y Centroamérica. Su visión de sostenibilidad e innovación la posiciona como actor clave en la transición energética regional.','73.11','Sun Nov 02 2025 00:39:46 GMT-0500 (hora estándar de Colombia)','CSCO');
INSERT INTO `empresas` VALUES('6','Banco de Bogota','Una de las instituciones financieras más antiguas y sólidas del país. Ofrece servicios bancarios, de inversión y financiación empresarial. Su enfoque en transformación digital y expansión internacional fortalece su competitividad en el mercado latinoamericano.','202.49','Sun Nov 02 2025 05:56:15 GMT-0500 (hora estándar de Colombia)','NVDA');
INSERT INTO `empresas` VALUES('7','Corporación Favorita','Principal grupo de retail en Ecuador, dueño de cadenas como Supermaxi y Megamaxi. Combina eficiencia logística con innovación en experiencia de compra. Su crecimiento constante y diversificación en bienes raíces e inversión hacen de Favorita un referente del comercio moderno ecuatoriano.','205.47','Sun Nov 02 2025 05:56:20 GMT-0500 (hora estándar de Colombia)','RY.TO');
INSERT INTO `empresas` VALUES('8','Corporación Multibg','Holding empresarial con presencia en banca, tecnología y servicios corporativos. Destaca por impulsar la digitalización de servicios financieros y la innovación en soluciones empresariales integradas, consolidando su papel como un jugador emergente en el mercado ecuatoriano.','243.86','Sun Nov 02 2025 05:55:31 GMT-0500 (hora estándar de Colombia)','SHOP.TO');
INSERT INTO `empresas` VALUES('9','Banco Bolivariano','Banco privado de trayectoria sólida, enfocado en banca comercial y digital. Su visión centrada en la innovación y atención personalizada lo posiciona como una de las entidades más modernas y confiables del sistema financiero ecuatoriano.','112.96','Thu Oct 23 2025 08:50:06 GMT-0500 (hora estándar de Colombia)','TD.TO');
INSERT INTO `empresas` VALUES('10','Inversancarlos','Grupo de inversión diversificado que participa en sectores de construcción, energía y servicios. Su enfoque en proyectos sostenibles y asociaciones estratégicas le permite generar valor en mercados en crecimiento dentro de Ecuador y la región andina.','65.4','Sun Nov 02 2025 05:55:33 GMT-0500 (hora estándar de Colombia)','ENB.TO');
INSERT INTO `empresas` VALUES('11','Continental Tire','Filial regional del grupo alemán Continental AG, dedicada a la manufactura y distribución de neumáticos. Su planta en Ecuador es una de las más avanzadas de Sudamérica, y la compañía impulsa soluciones de movilidad seguras, eficientes y sostenibles.','18.44','Sun Nov 02 2025 05:55:35 GMT-0500 (hora estándar de Colombia)','AC.TO');
INSERT INTO `empresas` VALUES('12','Tecateak','Empresa ecuatoriana especializada en la producción y exportación de madera de teca de alta calidad. Su modelo de manejo forestal sostenible la ha posicionado en mercados internacionales como proveedor confiable para la industria maderera y náutica.','32.02','Sun Nov 02 2025 05:55:36 GMT-0500 (hora estándar de Colombia)','CNQ');
INSERT INTO `empresas` VALUES('13','Banco de Crédito','Principal institución bancaria del país, con liderazgo en banca comercial y digital. Forma parte del Grupo Credicorp, con amplia presencia regional. Su estabilidad financiera y enfoque en innovación lo hacen atractivo para inversiones seguras y sostenibles.','43.77','Thu Oct 23 2025 08:50:06 GMT-0500 (hora estándar de Colombia)','BHP.AX');
INSERT INTO `empresas` VALUES('14','Sociedad Minera','Empresa minera peruana dedicada a la extracción y procesamiento de metales como cobre, zinc y plata. Comprometida con estándares ambientales y sociales, busca equilibrar rentabilidad y sostenibilidad en un sector estratégico para la economía peruana.','171.64','Sun Nov 02 2025 06:35:34 GMT-0500 (hora estándar de Colombia)','CBA.AX');
INSERT INTO `empresas` VALUES('15','Intercorp Services','Holding diversificado del Grupo Intercorp, con operaciones en banca, retail, educación y salud. Su estrategia de inversión a largo plazo y enfoque en la mejora de la calidad de vida de los peruanos le ha permitido mantener un crecimiento sostenido y diversificado.','38.8','Thu Oct 23 2025 08:50:07 GMT-0500 (hora estándar de Colombia)','WBC.AX');
INSERT INTO `empresas` VALUES('16','Banco BBVA','Parte del grupo financiero global BBVA, ofrece servicios bancarios integrales con fuerte orientación digital. Su estrategia se basa en la innovación tecnológica y el acompañamiento personalizado a clientes individuales y corporativos.','26.51','Thu Oct 23 2025 08:50:07 GMT-0500 (hora estándar de Colombia)','WOW.AX');
INSERT INTO `empresas` VALUES('17','MinSur','Una de las principales mineras de estaño y cobre del país, reconocida por sus prácticas sostenibles y eficiencia operativa. Pertenece al Grupo Breca, y se destaca por su capacidad de adaptación a la demanda global de metales estratégicos para la transición energética.','178.5','Sun Nov 02 2025 05:55:42 GMT-0500 (hora estándar de Colombia)','CSL.AX');
INSERT INTO `empresas` VALUES('18','ScotiaBank','Filial del grupo canadiense Scotiabank. Ofrece servicios financieros diversificados, con una fuerte apuesta por la digitalización y la inclusión financiera. Es una de las entidades más confiables y con mayor respaldo internacional en el mercado peruano.','21.29','Sun Nov 02 2025 05:55:40 GMT-0500 (hora estándar de Colombia)','FMG.AX');
INSERT INTO `empresas` VALUES('19','Banco Provincial','Parte del grupo español BBVA, es uno de los bancos líderes en Venezuela. Su solidez, amplia red y enfoque digital lo mantienen como un actor clave en el sistema financiero, incluso en contextos económicos desafiantes.','1063.4','Sun Nov 02 2025 05:55:58 GMT-0500 (hora estándar de Colombia)','HSBA.L');
INSERT INTO `empresas` VALUES('20','Mercantil','Institución financiera con más de 90 años de trayectoria. Ofrece productos en banca personal, empresarial y de inversión. Su diversificación, innovación digital y resiliencia la posicionan como una de las entidades más confiables del país.','442.3','Sun Nov 02 2025 05:55:56 GMT-0500 (hora estándar de Colombia)','BP.L');
INSERT INTO `empresas` VALUES('21','ProAgro','Empresa venezolana líder en el sector agroindustrial, dedicada a la producción y comercialización de alimentos balanceados, proteínas y materias primas agrícolas. Su modelo de integración vertical le otorga eficiencia y estabilidad en un mercado de alta demanda alimentaria. ProAgro busca consolidarse como referente en sostenibilidad y autosuficiencia alimentaria regional.','92.14','Sun Nov 02 2025 05:55:54 GMT-0500 (hora estándar de Colombia)','VOD.L');
INSERT INTO `empresas` VALUES('22','Cerámica Carabobo','Reconocida compañía venezolana con más de 60 años de experiencia en la fabricación de revestimientos cerámicos y porcelanatos de alta calidad. Combina innovación tecnológica con diseño y sostenibilidad, exportando a diversos países de América y el Caribe. Su sólida reputación y capacidad productiva la hacen una opción atractiva para inversiones industriales y de infraestructura.','4589','Sun Nov 02 2025 05:55:47 GMT-0500 (hora estándar de Colombia)','ULVR.L');
INSERT INTO `empresas` VALUES('23','VeneAlternative','Fondo y grupo empresarial enfocado en el desarrollo de proyectos sostenibles y alternativos en Venezuela, con énfasis en energías limpias, agroindustria ecológica y tecnologías verdes. Su enfoque en innovación y alianzas estratégicas internacionales le permite acceder a nichos emergentes con alto potencial de rentabilidad y bajo impacto ambiental.','1167','Sun Nov 02 2025 06:55:01 GMT-0500 (hora estándar de Colombia)','RR.L');
INSERT INTO `empresas` VALUES('24','PIVCA','Holding industrial diversificado que opera en manufactura, materiales de construcción y soluciones logísticas. PIVCA se distingue por su resiliencia, adaptación tecnológica y orientación a la exportación, convirtiéndose en un pilar de la reactivación industrial venezolana. Su estructura moderna y enfoque en eficiencia operativa la posicionan favorablemente para capital de expansión.','9486','Sun Nov 02 2025 05:55:52 GMT-0500 (hora estándar de Colombia)','LSEG.L');
